import React, {useContext} from "react";
import {ApiContext} from "../context/ApiContext"

export default function Prueba() {
    const api = useContext(ApiContext)
    let user = ""
    api.getUser().then(response => { user = response.data })
    console.log(user);


    return (
        <div>
            {api}
        </div>
    )
}
